import React,{useState} from "react";
import fetcher from "./functions/fetcher";
import formater from "./functions/formater";
import {
  Routes,
  Route,
  BrowserRouter,
  useNavigate
} from "react-router-dom";
import Main from "./screens/Main/index";
import Header from "./globalComponents/header/index";
import "./assets/styles/globalStyles.css";
const App=()=> {
  const [searchActive,setSearchActive]=useState(false);
  return (<BrowserRouter>
      <Header setSearchActive={setSearchActive}/>
     <Routes>
      <Route path="/" element={<Main {...{searchActive,setSearchActive}}/>} />
      <Route path="/passwordGenerator" element={<Main/>}/>
      <Route path="/library" element={<Main/>}/>
      <Route path="/signIn" element={<Main/>}/>
      <Route path="/signUp" element={<Main/>}/>
      <Route path="/preview" element={<Main/>}/>
      <Route path="/cabinet" element={<Main/>}/>
    </Routes>
  </BrowserRouter>)
}
export default App;
